import 'react-native-gesture-handler';
import React, { useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Button, TouchableOpacity} from 'react-native';

const AssessmentScore = ({navigation}) => {
  const [score, setScore] = useState(1);

  return (
    <View style={styles.container}>

    <Text style = {[styles.defaultText, {fontWeight: "bold"}, {margin: 20}]}>Here is your score on the pre-assessment:</Text>
    <Text style = {styles.textScore}> Your Score: {score} </Text>
    <Text style = {styles.textScore}> Passing Score: 80% </Text>
    <Text style = {[styles.defaultText, {margin: 20}]}> You will need to complete this course to receive credit. Click the next to start the course. </Text>

    <View style={{ flexDirection: 'row', margin: 10 }}>
        <View style = {styles.navBtnContainer}>
            <Button
              title="Back"
            />
        </View>

        <View style = {styles.navBtnContainer}>
            <Button
              title="Next"
            />
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#EFEFEF',
    alignItems: 'center',
    justifyContent: 'center',
    padding: 40
   },
   contentContainer: {
    padding: 20
   },
   button: {
      padding: 20,
      fontSize: 15,
      fontFamily: "arial",
      textAlign: "center",
      color: "#0061A5",
      borderRadius: 10,
      borderWidth: 1,
      borderColor: '#fff',
    },
    buttonContainer: {
      width: "20%",
      margin: 10,
      backgroundColor: "#004473",
    },
    questionContainer: {
        width: "70%",
        margin: 20,
        alignItems: "center",
        padding: 10
    },
    navBtnContainer: {
        margin: 20
    },
    reviewQuestionnaireContainer: {
        backgroundColor: "#FFF",
        padding: 10,
        width: "30%",
        borderColor: "#004473",
        borderRadius: 20,
        alignItems: "center",
        margin: 10
    },
    defaultButton: {
        backgroundColor: "#004473",
        width: "15%",
        margin: 20,
        marginTop:30
    },
    textButton: {
        color: "white",
        fontWeight: "bold",
        alignItems: "center",
        textAlign: "center",
        fontSize: 18
    },
    textScore: {
        color: "#CF4B04",
        fontWeight: "bold",
        alignItems: "center",
        textAlign: "center",
        fontSize: 20
}
});

export default AssessmentScore;
